import React from 'react';

function HomePage() {
  return (
    <div>
      <h1>Welcome to EstoBest</h1>
      <p>This is your homepage content.</p>
      <h1 className="text-3xl font-bold underline">
        Hello world!
      </h1>
    </div>
  );
};

export default HomePage;
